import AllQuickStats from './QuickStats'
import React, { Component } from 'react';



class Dashboard extends Component{
	componentDidMount() {
		this.props.retrieveOrders();
		this.props.retrieveInvoices();
		this.props.retrieveShippingAddresses();
		this.props.retrieveCustomers();

        this.props.retrieveProducts();
	}
	render() {
		return (
			<div id='Dashboard'>
				<h1>Dashboard</h1>
				<AllQuickStats/>
			</div>
		);
	}
}

const mapStateToProps = (state) => {
	return {
		orders: state.orders,
        shippingAddresses: state.shippingAddresses,
		customers: state.customers,
		invoices: state.invoices,
		orderline: state.orderline,
		products: state.products
	};
  };
  
export default connect(mapStateToProps, { retrieveCustomer, deleteOrder, retrieveOrder, updateOrder, retrieveShippingAddress, retrieveProducts, findBySKU, findOrderLineByOrderID, retrieveInvoice })(Dashboard);
